import React, { Component } from 'react';
import PropTypes from 'prop-types';
// templates
import { TypeForm } from 'container/templates';

// thisComponents
import BondsBuyPagination from './thisComponents/BondsBuyPagination';
import BondsBuyContent from './thisComponents/BondsBuyContent';

import './styles.scss';

class BondsBuy extends Component {
  state = {

  };

  componentDidMount() {
  }

  // render
  render() {
    const {
      handleClosePage,
      handleShowPagination,
      state: { showSteps }
    } = this;

    return (
      <TypeForm
        className='p-bonds-buy'
        content={<BondsBuyContent showPagination={handleShowPagination} />}
        steps={<BondsBuyPagination />}
        closePage={handleClosePage}
        showSteps={showSteps}
      />
    );
  }
}

BondsBuy.propTypes = {
  history: PropTypes.object
};

BondsBuy.defaultProps = {
  history: {}
};

export default BondsBuy;
